import {Link} from "react-router-dom";
import React from "react";
import Saved from "../SavedBooks";
function NavBar() {
    return(
        <div className="header"  style={{
            backgroundImage:`url('https://images.unsplash.com/photo-1497633762265-9d179a990aa6?ixid=MnwxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8&ixlib=rb-1.2.1&auto=format&fit=crop&w=1052&q=80')`,
            backgroundRepeat:'no-repeat',    
            height:'30vh',
            width:'100vh'
        }}>
        <nav 
        className="navbar navbar-expand-lg text-light">
            <div className="container">
                <Link className="navbar-brand" to="/">Google Books</Link>
                <ul className="navbar-nav">
                <li className="nav-item">
                    <Link to="/" className={window.location.pathname === "/" ? "nav-link active" : "nav-link"}>
                        Search
                    </Link>
                </li>
                <li className="nav-item">
                    <Link to="/saved" className={window.location.pathname === "/saved" ? "nav-link-active" : "nav-link"}>
                        Saved Books
                    </Link>
                </li>
                </ul>
            </div>
        </nav>
    </div>
    )
}

export default NavBar;
